import React, { useState, useEffect } from 'react';

function GuestPage() {
    const [screeningsData, setScreeningsData] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/screenings/allScreenings')
            .then(response => response.json())
            .then(data => {
                setScreeningsData(data);
            })
            .catch(error => console.error(error));
    }, []);

    return (
        <div>
            <h1>Welcome as Guest</h1>
            <h2>Screenings:</h2>
            <ul>
                {screeningsData.map(screening => (
                    <li key={screening.id}>
                        <p>Screening ID: {screening.id}</p>
                        <p>Screenable Movie's ID: {screening.movieId}</p>
                        <p>Room's ID: {screening.roomId}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default GuestPage;
